import React, {Component} from 'react';
import './App.css';
import ImageIndex from './components/ImageIndex';
import Filter from './components/Filter'

class App extends Component {
  state = {
    dimension:''
  }

  filterPictures = (pictures) => {
    console.log(pictures)
  }
  render(){
    return (
      <div className="App">
        <h1>Photo Viewer App</h1>
        <Filter filterPictures={this.filterPictures()}/>
        <ImageIndex />
      </div>
    );
  }
}

export default App;
